const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Find the best equipment that fits to your surgeries, Delivered To You</h2>
      <p>
        Choose the best option that fits your hospital need, from our broad selection of available equipments.
      </p>
      <p>
        All our products were certified by goberment institute.
      </p>
    </section>
  );
};

export default MealsSummary;
